dfrapCfgFrDLCIMode = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 1, 5, 1), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6))).clone(namedValues=NamedValues(("inactive", 1), ("local", 2), ("remote", 3), ("bidirectional", 4), ("piggyback", 5), ("fixed-dce", 6)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dfrapCfgFrDLCIMode.setStatus('mandatory')
if mibBuilder.loadTexts: dfrapCfgFrDLCIMode.setDescription('In-band Frame Relay management mode. A variety of options exist which are differentiated by how PVCs can be provisioned to manage the unit and the resulting impact to the logical processing of Link Management Protocol messages (LMI spoofing and sourcing). The unit is designed to support these management modes even in non-provisioned or failed frame relay networks. This setting also has implications upon how networking protocols such as ARP and InARP are handled by the unit. (1) inactive: in-band management is not enabled (2) local DLCI mode: in-band managed using a private dedicated DLCI accessible via the DTE port only. A DLCI value is configured which, through LMI spoofing, will only be visible to the DTE equipment and need not be provisioned on the WAN. All traffic on this DLCI will be terminated by the unit. (3) remote DLCI mode: in-band managed using a private dedicated DLCI accessible via the WAN port only. A DLCI value is configured which, through LMI spoofing, will only be visible from the WAN side and will not be seen by any DTE equipment. All traffic on this DLCI will be terminated by the unit. (4) bidirectional mode: in-band managed using a private dedicated DLCI accessible through either port. A DLCI value is configured which is expected to be fully provisioned in the frame relay network but dedicated to the management function of this particular unit. All traffic on this DLCI will be terminated by the unit. (5) piggyback mode: in-band managed using any DLCI on any interface. A DLCI value is defined that becomes the default DLCI that will be maintained by the unit during network or LMI failure conditions. The unit will terminate and respond accordingly to management and networking data while transparently passing on user data. (6) fixed DCE mode: special mode of operation to support frame relay applications that do not include a switch (frame relay DCE). The unit will independently respond to LMI requests on each interface and will provision the configured DLCI to each Frame Relay DTE device. Except for this, the unit behaves like piggyback.')
dfrapCfgFrDLCIValue = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 1, 5, 2), Integer32().subtype(subtypeSpec=ValueRangeConstraint(16, 63487))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dfrapCfgFrDLCIValue.setStatus('mandatory')
if mibBuilder.loadTexts: dfrapCfgFrDLCIValue.setDescription('If in-band management is being used this DLCI value should be defined. In all modes of in-band management with the LMI Sourcing feature enabled the unit may provision this DLCI during LMI failure to facilitate management access. In Private modes (Local, Remote, and Bidirectional) this is the dedicated DLCI for management data and address resolution protocols - all other traffic on this DLCI will be discarded. In Piggyback mode this DLCI is treated like all others except during LMI failure sourcing when it may be provisioned by the unit. In Piggyback mode if InARP is enabled on a single DLCI then this value defines that DLCI.')
dfrapCfgFrDLCIEncap = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 1, 5, 3), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("rfc1490", 1), ("rfc1490snap", 2), ("auto", 3), ("cisco", 4)))).setMaxAccess("readwrite")
