if mibBuilder.loadTexts: dfrapCfgFrDLCIEncap.setDescription('This is the protocol used for enacapsulating and formatting ip data for Frame Relay transmission. This setting is specific to management data to and from the unit. (1)RFC1490 - per IETF standard with Network Level Protocol ID (NLPID) set for IP encapsulation. (2)RFC1490 SNAP/IP - per IETF standard with NLPID set for Sub-Network Access Protocol (SNAP). (3)auto - adjusts to either of these encapsulation techniques as required. (4)Cisco - proprietary encapsulation (4-byte header).')
dfrapCfgFrDLCIMgmtDE = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 1, 5, 4), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("no-DE-bit-0", 1), ("yes-DE-bit-1", 2)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dfrapCfgFrDLCIMgmtDE.setStatus('mandatory')
if mibBuilder.loadTexts: dfrapCfgFrDLCIMgmtDE.setDescription('Provides user control over the state of the Frame Relay Discard Eligibility bit of all management frames generated by the unit. Frames marked DE=1 are more likely to be dropped in a congested Frame Relay network than those that are DE=0. Heavily congested circumstances can cause both to be dropped. Additionally, frames marked DE=0 may get re-marked to DE=1 by intervening equipment. (1) DE bit cleared to 0: frame is not discard eligible (2) DE bit set to 1: frame is discard eligible')
dfrapCfgAppTable = MibIdentifier((1, 3, 6, 1, 4, 1, 485, 6, 2, 2))
dfrapCfgAppClockSource = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 2, 1), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3))).clone(namedValues=NamedValues(("internal", 1), ("network", 2), ("dte", 3)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dfrapCfgAppClockSource.setStatus('mandatory')
if mibBuilder.loadTexts: dfrapCfgAppClockSource.setDescription('Timing source for transmission of data towards the WAN and for the generation of DTE clocking. There should be only one source per end-to-end WAN link. Unit is typically network timed in a point-to-network application. (1) internal: derive timing from a high-stability on-board crystal oscillator. (2) network: or Loop timing, derive timing from the signal received at the WAN interface (3) dte: derive timing from the clock presented by the DTE equipment on the Terminal Timing(TT)/Transmit Clock External (TCE) leads. This setting expects the DTE timing mode to be Loop 1 and the DTE device to be generating a clock at the DTE data rate.')
