if mibBuilder.loadTexts: dfrapCfgAppType.setStatus('mandatory')
if mibBuilder.loadTexts: dfrapCfgAppType.setDescription('This unit provides many features specifically adapted to Frame Relay transmission links; this includes diagnostic utilities, statistical analysis, protocol trends, quality of service reporting, and in-band SNMP management. If the unit will be operating in a Frame Relay network the Application Type must be set to Frame Relay to enable these features. To operate in a non-Frame Relay network or to bypass this feature set the unit may be placed in Dedicated mode and will emulate a more familiar DSU/CSU. Note - changing this value will automatically change the Application Format setting and vice versa. (1) dedicated: protocol-independent transparent DSU/CSU (2) Frame Relay: Frame and protocol aware DSU/CSU')
