if mibBuilder.loadTexts: dfrapCfgAppPerfBuffLimit.setDescription('This value controls the throttling mechanism used to determine the optimum level of statistical processing versus managability of the unit. The lower the value (1 - 128), the unit becomes more responsive to management commands during very heavy utilization at the possible expense of statistical accuracy. The larger the value (129 - 512), the more accurate the DFRAP performs statistical analysis of the frames but management may seem slow or unresponsive during periods of very heavy link utilization. NOTE: A value of 0 disables statistical processing entirely.')
