dfrapCfgDteClockMode = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 4, 3), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("clock-normal", 1), ("clock-invert", 2)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dfrapCfgDteClockMode.setStatus('mandatory')
if mibBuilder.loadTexts: dfrapCfgDteClockMode.setDescription('This selection controls how the unit internally latches the transmit data from the DTE. Normal will sample data with the rising edge of the selected TX Clock, Invert will sample data with the falling edge of the selected TX Clock. The TX Clock is selected using CfgDteTiming. This clock invertion is most useful when loop-2 timing is used - particularly at higher rates and with long cable runs. Only in rare circumstances will clock-invert be used with loop-1 timing. If the DTE Interface TX statistics are indicating excessive crc errors or aborts then changing this setting may have some benefit. (1) normal (2) invert')
dfrapCfgDteTiming = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 4, 4), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("loop-1", 1), ("loop-2", 2)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dfrapCfgDteTiming.setStatus('mandatory')
if mibBuilder.loadTexts: dfrapCfgDteTiming.setDescription('Serial DTE Transmit Timing mode. Loop-1 (1) uses the clock returned from the DTE (TT/TCE) to sample tx data, Loop-2 (2) uses the clock (ST/TC) generated by the node to sample tx data. Loop-1 is the preferred mode. Loop-2 timing could experience data errors at high rates or due to long DTE cable runs - may need to Invert the clock (see CfgDteClockMode). (1) Loop 1: external clock returned from DTE with data (2) Loop 2: internal clock used to sample incoming data')
dfrapCfgDteRts = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 4, 15), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("internal-held-active", 1), ("external-from-dte", 2)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dfrapCfgDteRts.setStatus('mandatory')
