dfrapCfgDteDcdOutput = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 4, 18), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6, 7, 8))).clone(namedValues=NamedValues(("signal-off", 1), ("signal-on", 2), ("follow-carrier", 3), ("follow-test", 4), ("follow-rts", 5), ("follow-carrier-rts", 6), ("follow-sync-rts", 7), ("follow-lmi-carr-rts", 8)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dfrapCfgDteDcdOutput.setStatus('mandatory')
if mibBuilder.loadTexts: dfrapCfgDteDcdOutput.setDescription('Specifies the behavior of the Data Carrier Detect (DCD) control signal generated by the unit towards the DTE. (1) inactive always: signal is permanently INACTIVE. (2) active always: signal is permanently ACTIVE. (3) reflect WAN carrier: signal echoes the received signal status from the WAN. (4) inactive with test mode: signal is ACTIVE during normal data transfer and INACTIVE during diagnostic conditions that interfere with data transfer from the DTE to the WAN. (5) follow RTS: signal echoes the status of RTS as processed from the DTE. (6) reflect carrier and RTS: signal is a logical AND between RTS processed from the DTE and the received signal status from the WAN. No signal received from the WAN or RTS INACTIVE will cause this control signal to be asserted INACTIVE. (7) reflect sync and RTS: signal is a logical AND between RTS processed from the DTE and the frame synchronization with the WAN. Frame Synchronization is only applicable with 64K DDS service, otherwise this is equivalent to (6). (8) reflect LMI and carrier and RTS: signal is a logical AND between RTS processed from the DTE and the carrier signal status from the WAN and LMI. If the unit is in an LMI passthrough state then LMI is considered Active. LMI Inactivity timer must be non-zero for LMI to be declared Inactive. In non-Frame Relay applications (type = dedicated) LMI will be presumed ACTIVE so this will setting is equivalent to (6). Note that there is a separate parameter for how the unit processes RTS that is related to this function if options (4), (5), (6), or (7) is selected, see CfgDteRts.')
dfrapCfgDteDsrOutput = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 4, 19), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6, 7, 8))).clone(namedValues=NamedValues(("signal-off", 1), ("signal-on", 2), ("follow-carrier", 3), ("follow-test", 4), ("follow-rts", 5), ("follow-carrier-rts", 6), ("follow-sync-rts", 7), ("follow-lmi-carr-rts", 8)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dfrapCfgDteDsrOutput.setStatus('mandatory')
if mibBuilder.loadTexts: dfrapCfgDteDsrOutput.setDescription('Specifies the behavior of the Data Set Ready (DSR) control signal generated by the unit towards the DTE. (1) inactive always: signal is permanently INACTIVE. (2) active always: signal is permanently ACTIVE. (3) reflect WAN carrier: signal echoes the received signal status from the WAN. (4) inactive with test mode: signal is ACTIVE during normal data transfer and INACTIVE during diagnostic conditions that interfere with data transfer from the DTE to the WAN. (5) follow RTS: signal echoes the status of RTS as processed from the DTE. (6) reflect carrier and RTS: signal is a logical AND between RTS processed from the DTE and the received signal status from the WAN. No signal received from the WAN or RTS INACTIVE will cause this control signal to be asserted INACTIVE. (7) reflect sync and RTS: signal is a logical AND between RTS processed from the DTE and the frame synchronization with the WAN. Frame Synchronization is only applicable with 64K DDS service, otherwise this is equivalent to (6). (8) reflect LMI and carrier and RTS: signal is a logical AND between RTS processed from the DTE and the carrier signal status from the WAN and LMI. If the unit is in an LMI passthrough state then LMI is considered Active. LMI Inactivity timer must be non-zero for LMI to be declared Inactive. In non-Frame Relay applications (type = dedicated) LMI will be presumed ACTIVE so this will setting is equivalent to (6). Note that there is a separate parameter for how the unit processes RTS that is related to this function if options (4), (5), (6), or (7) is selected, see CfgDteRts.')
dfrapCfgDteCtsOutput = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 4, 20), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6, 7, 8))).clone(namedValues=NamedValues(("signal-off", 1), ("signal-on", 2), ("follow-carrier", 3), ("follow-test", 4), ("follow-rts", 5), ("follow-carrier-rts", 6), ("follow-sync-rts", 7), ("follow-lmi-carr-rts", 8)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dfrapCfgDteCtsOutput.setStatus('mandatory')
if mibBuilder.loadTexts: dfrapCfgDteCtsOutput.setDescription('Specifies the behavior of the Clear to Send (CTS) control signal generated by the unit towards the DTE. (1) inactive always: signal is permanently INACTIVE. (2) active always: signal is permanently ACTIVE. (3) reflect WAN carrier: signal echoes the received signal status from the WAN. (4) inactive with test mode: signal is ACTIVE during normal data transfer and INACTIVE during diagnostic conditions that interfere with data transfer from the DTE to the WAN. (5) follow RTS: signal echoes the status of RTS as processed from the DTE. (6) reflect carrier and RTS: signal is a logical AND between RTS processed from the DTE and the received signal status from the WAN. No signal received from the WAN or RTS INACTIVE will cause this control signal to be asserted INACTIVE. (7) reflect sync and RTS: signal is a logical AND between RTS processed from the DTE and the frame synchronization with the WAN. Frame Synchronization is only applicable with 64K DDS service, otherwise this is equivalent to (6). (8) reflect LMI and carrier and RTS: signal is a logical AND between RTS processed from the DTE and the carrier signal status from the WAN and LMI. If the unit is in an LMI passthrough state then LMI is considered Active. LMI Inactivity timer must be non-zero for LMI to be declared Inactive. In non-Frame Relay applications (type = dedicated) LMI will be presumed ACTIVE so this will setting is equivalent to (6). Note that there is a separate parameter for how the unit processes RTS that is related to this function if options (4), (5), (6), or (7) is selected, see CfgDteRts.')
