dfrapCfgFrAddrResMode = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 5, 6), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("inactive", 1), ("arp", 2), ("inarp", 3), ("both", 4)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dfrapCfgFrAddrResMode.setStatus('mandatory')
if mibBuilder.loadTexts: dfrapCfgFrAddrResMode.setDescription("The ip-based Address Resolution protocol supported in the application. With ARP, requests are received and replies are generated accordingly. With InARP, requests are received and replies are generated; additionally, InARP requests are issued by the unit at the frequency defined by the InARP timer. Address Resolution will circumvent the need for static routes and automatically log an associated dynamic entry into the routing tables. (1) inactive: no address resolution support (2) ARP: only provide ARP responses. ARP is useful when the router knows the unit's ip address but doesn't know the DLCI. (3) InARP: provide both InARP responses and InARP requests. InARP is useful when the router knows the DLCI but not the ip address. (4) Both ARP and InARP.")
dfrapCfgFrAddrResDlcis = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 5, 9), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("single", 1), ("multiple", 2), ("ddsmulti", 3), ("dtemulti", 4)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dfrapCfgFrAddrResDlcis.setStatus('mandatory')
if mibBuilder.loadTexts: dfrapCfgFrAddrResDlcis.setDescription('Address Resolution Dlcis determines which dlcis will support address resolution. In Private management modes (Local, Remote, Bidirectional), address resolution runs on the single defined management DLCI only (regardless of this setting). In Piggyback management the user has options based upon two models: Single, where the address resolution protocols run only upon the defined managment DLCI and Multiple, where its supported on all active DLCIs recognized by the unit. (1) Single - address resolution on the defined default DLCI on both ports (2) Multiple - address resolution on all active DLCIs on both ports (3) DDSMulti - Single on DTE and Multiple on DDS (4) DTEMulti - Single on DDS and Multiple on DTE')
