dfrapCfgFrLmiFullStatus = MibScalar((1, 3, 6, 1, 4, 1, 485, 6, 2, 5, 8), Integer32().subtype(subtypeSpec=ValueRangeConstraint(0, 3600))).setMaxAccess("readwrite")
